import React from 'react';
import { GoogleLogin } from 'react-google-login';
import { withRouter } from 'react-router-dom';

const responseGoogle = (response, history) => {
  console.log(response);

  if (response.profileObj) {
    const { imageUrl, name, email } = response.profileObj;
    console.log('Profile Photo URL:', imageUrl);
    console.log('Name:', name);
    console.log('Email:', email);

    history.push('/dashboard');
  } else {
    history.push('/login');
  }
};

const GoogleLoginButton = ({ history }) => {
  return (
    <GoogleLogin
      clientId="YOUR_GOOGLE_CLIENT_ID"
      buttonText="Login with Google"
      onSuccess={(response) => responseGoogle(response, history)}
      onFailure={(response) => responseGoogle(response, history)}
      cookiePolicy={'single_host_origin'}
    />
  );
};

export default withRouter(GoogleLoginButton);
